- input: "TEXT\x1CC00114439\x1CTEXT-00001\x1C\x1CF3XA\x1CPlease note that the report
    is being amended to restore the debt schedule as originally filed with respect
    to J. Blair Butterworth Associeates for debts totaling 73,266.78. The report was
    initially amended because of a mistaken belief that mailings for which these vendors
    were paid was disseminated on October 13, 2008. However, we recently discovered
    that the mailings were disseminated on October 23, 2008. Therefore, these debts
    should not have been included on either report since they were incurred and paid
    within the Post-General reporting period.  On 10/10/08, the WSDCC transferred
    back $2,000 of Levin funds to non-federal.  The amount is the portion of the Verizon
    conversion on 2/29/08 which was raised in a fundraiser paid for with non-federal
    and federal funds based on the funds received method.  See Schedule L, Line 5,
    and Schedule L-B.  The Democratic Governors Association's aggregate year-to-date
    of Levin contributions of $20,000 is divided as follows: $10,000 is a conversion
    of 2007 allowable, unspent non-federal contributions converted on 2/15/08, and
    $10,000 is 2008 contributions converted on 10/10/08.  See Schedule L-A.  All salaries,
    related taxes, and benefits reported on Schedule H4 are for employees working
    25% or less of their time during the month on federal election activities; and
    all salaries, related taxes, and benefits on Schedule B, Line 30b are for employees
    working > 25% or their time during the month on federal election activities.\n"
